update Transformation

The update Transformation updates the specified field values in an existing dataset based on data from another dataset, which we call the lookup dataset.

When you create the transformation, you specify the keys that are used to match records between the two datasets. You also map the corresponding fields from both datasets.

For example, you have an existing Accounts dataset and a new .csv file with updated account names and associated account IDs.

Create a dataflow definition file to update account names in the Accounts dataset by looking up the new account names in the UpdatedAccountNames dataset.

You create the following dataflow definition file.

{
   "Extract_AccountDetails": {
      ...
   },
   "Update_AccountRecords": {
      "action": "update",
      "parameters": {
         "left": "Extract_AccountDetails",
         "right": "UpdatedAccountNames",
         "left_key": [ "Id" ],
         "right_key": [ "AccountId" ],
         "update_columns": { "Name": "NewAccountName" }
      }
   },
   "Register_UpdatedAccountRecords": {
      ...
   }
}

You can also use a composite key to match records between both datasets.

{
   "Extract_AccountDetails": {
      ...
   },
   "Update_AccountRecords": {
      "action": "update",
      "parameters": {
         "left": "Extract_AccountDetails",
         "right": "UpdatedAccountNames",
         "left_key": ["Id","Name"],
         "right_key": ["AccountId","NewAccountName"],
         "update_columns": { ... }
      }
   },
   "Register_UpdatedAccountRecords": {
      ...
   }
}

When you define an update transformation, you set the action attribute to update and specify the parameters.
